cs:"<uu5string/>Tato sekce umožňuje nastavit implicitní práva na artefakt. Každý artefakt má profily (první sloupec). Přiřazením rolí a skupin k profilu jim umožníte číst nebo spravovat daný artefakt. První řádka v matici znázorňuje skupiny domácí jednotky artefaktu. Nastavení implicitních oprávnění spočívá v mapování těchto skupin na profily tohoto artefaktu. Skupinu obsadíte do příslušného profilu označením checkboxu ve sloupci pod ní. Skupina Authorities musí být vždy obsazena do profilu Authorities. Více informací naleznete v knize <UU5.Bricks.Link content='uuBusinessTerritory BusinessModel' href='https://uuapp.plus4u.net/uu-bookkit-maing01/e63726a97e3f4fc6b452476eeaf2a025/book/page?code=37055213' target='_blank'/>.",
en:"<uu5string/>This section allows you to set implicit permissions to the artifact. Each artifact has profiles (first column). Roles and groups have permissions to read or manage the artifact only when they are cast in the relevant profile. The first line in the matrix represents the unit groups of artifact's home unit. The implicit permissions are set by mapping these groups to the artifact's profiles. You can cast a group in the appropriate profile by checking the checkbox in the column below it. The unit group Authorities must always have cast in the profile Authorities. For more information visit <UU5.Bricks.Link content='uuBusinessTerritory BusinessModel' href='https://uuapp.plus4u.net/uu-bookkit-maing01/e63726a97e3f4fc6b452476eeaf2a025/book/page?code=37055213' target='_blank'/>."
