cs:"<uu5string/>Podstatou nastavení explicitního oprávnění je obsazení konkrétní role či skupiny do jednoho či více profilů artefaktu. Pro nastavení explicitního obsazení slouží modré tlačítko Přidat explicitní právo. Explicitně lze obsadit roli, skupinu, přístupovou roli či skupinu teritoria. Pro to, aby mohla být nějaká role nebo skupina (mimo přístupovou roli či skupinu teritoria) do profilu artefaktu explicitně obsazena, musí se nacházet ve stejné jednotce jako artefakt.K jednomu artefaktu lze nastavit maximálně 100 explicitních oprávnění. Více informací naleznete v knize <UU5.Bricks.Link content='uuBusinessTerritory BusinessModel' href='https://uuapp.plus4u.net/uu-bookkit-maing01/e63726a97e3f4fc6b452476eeaf2a025/book/page?code=37055213' target='_blank'/>.",
